import React from "react"
import {useState} from "react"
import Axios from "axios"
import "./css/styles.css"
import Travel from "./images/travel.jpg"

function View(){
    const [name,setName] = useState("");
    const [age,setAge] = useState("");
    const [gender,setGender] = useState("");
    const [bloodGroup,setbloodGroup] = useState("");
    const [start,setStart] = useState("");
    const [startpin,setStartpin] = useState("");
    const [arriving,setArriving] = useState("");
    const [destpin,setDestpin] = useState("");
    const [date,setDate] = useState("");
    const [departure,setDeparture] = useState("");
    const [seat,setSeat] = useState("");
    const [tot,setTot] = useState("");
    const [fare,setFare] = useState("");
    const [transporttype,setTransporttype] = useState("");
    const [vehicleno,setVehicleno] = useState("");
    const [ticket,setTicket] = useState("");
    const [booking,setBooking] = useState("");
    const [verification,setVerification] = useState("");
    const [viewTable,setViewTable] = useState([])

   const Submit = () => {
       Axios.get("http://localhost:1000/view").then((response) => {
           setViewTable(response.data)
       })
   }
   return(
       <body>
       <div className="Button" style={{color:"white"}}>
       <img src={Travel}/>
       <button class = "btn btn-primary" style={{marginBottom:"15px",marginTop:"15px"}} onClick={Submit}>View</button>
       <table style={{width:"100%",color:"white"}} class="table table-success table-striped">
                  <tr>
                   <th>Booking_ID</th>
                   <th>Name</th>
                   <th>Age</th>
                   <th>Gender</th>
                   <th>Starting From</th>
                   <th>Verification_ID</th>
                  </tr>
       {viewTable.map((val,key) => {
           return(
                    <tr>
                    <td>{val.booking_id}</td>
                    <td>{val.name}</td>
                    <td>{val.age}</td>
                    <td>{val.gender}</td>
                    <td>{val.start_place}</td>
                    <td>{val.verification_id}</td>
                  </tr> 
           )
       })}</table></div>
       </body>
   )
}

export default View
